import React from 'react';
import { Image } from 'react-native';
import Onboarding from 'react-native-onboarding-swiper';

const styles = StyleSheet.create({
  logo: {
    width: 66,
    paddingBottom: 60
  },
});

const Swiper = ({navigation}) => (
    <Onboarding
    onDone={() => { 
      console.log('done');
      navigation.navigate("Calendar");
    }}

    pages={[
      {
        backgroundColor: '#F3EDEF',
        image: <Image source={require('../images/welcome.png')} style={styles.logo} />,
        title: 'hi there :)',
        subtitle: 'welcome to 80H Key',
      },
      {
        backgroundColor: '#CBECDF',
        image: <Image source={require('../images/book.png')} style={styles.logo} />,
        title: 'a tool',
        subtitle: 'to learn more about your ADHD life',
      },
      {
        backgroundColor: '#BDA9A7',
        image: <Image source={require('../images/data.png')} style={styles.logo} />,
        title: 'track and learn',
        subtitle: "about your mood and habits",
      },
    ]}
  />
);

export default Swiper;
